import styled from 'styled-components';
import {Commonpara,Commonh4,SectionHeading} from '../../../components/common.style';
import {SocialFacebook} from 'styled-icons/typicons/SocialFacebook'
import {SocialTwitter} from 'styled-icons/typicons/SocialTwitter'
import {SocialLinkedin} from 'styled-icons/typicons/SocialLinkedin'
import {SocialInstagram} from 'styled-icons/typicons/SocialInstagram'
import {device} from '../../../components/device';

export const TeamSection = styled.section`
    padding:100px 0px;
    background:#fafafa;

    @media ${device.tablet} {
        padding:80px 10px 50px;
    }
`;

export const HeadingLayout = styled.div`
    margin-bottom:75px;
    @media ${device.tablet} {
        margin-bottom:60px;
    }
`;

export const TeamHeading = styled(SectionHeading)`

`;

export const TeamLayout = styled.div`
    background:#fff;

    @media ${device.tablet} {
        margin-bottom:30px;
    }
`;

export const Img = styled.img`
    width:100%;
    object-fit:cover;
`;

export const TeamDetailsLayout = styled.div`
    text-align:center;
    padding:30px;

    @media ${device.laptop} {
        padding:20px;
    }

    @media ${device.tablet} {
        padding:30px;
    }
`;

export const Name = styled(Commonh4)`
    font-size:22px;
    line-height:22px;
    margin-bottom:10px;

    @media ${device.laptop} {
        font-size:20px;
    }
    @media ${device.tablet} {
        font-size:22px;
    }
`;

export const Designation = styled(Commonpara)`
    color:#2560d4;
`;

export const Divider = styled.hr`
    margin:10px 0px;
`;

export const SocialIconLayout = styled.div`

`;


export const InstaIcon = styled(SocialInstagram)`
    width: 35px;
    color: #ec008c;
    padding: 4px;
    border-radius:100%;
    margin: 10px 5px 0px;
    :hover{
        background: none;
        border:2px solid #ec008c;
    }

    @media ${device.laptop} {
        margin: 10px 3px 0px;
    }
    @media ${device.tablet} {
        margin: 10px 5px 0px;
    }
`;
export const LinkedinIcon = styled(SocialLinkedin)`
    width: 35px;
    color: #2e318f;
    padding: 4px;
    border-radius:100%;
    margin: 10px 5px 0px;
    :hover{
        background: none;
        border:2px solid #2e318f;
    }
    @media ${device.laptop} {
        margin: 10px 3px 0px;
    }
    @media ${device.tablet} {
        margin: 10px 5px 0px;
    }
`;
export const TwitterIcon = styled(SocialTwitter)`
    width: 35px;
    color: #00aeee;
    padding: 4px;
    border-radius:100%;
    margin: 10px 5px 0px;
    :hover{
        background: none;
        border:2px solid #00aeee;
    }
    @media ${device.laptop} {
        margin: 10px 3px 0px;
    }
    @media ${device.tablet} {
        margin: 10px 5px 0px;
    }
`;
export const FbIcon = styled(SocialFacebook)`
    width: 35px;
    color: #3949aa;
    padding: 4px;
    border-radius:100%;
    margin: 10px 5px 0px;
    :hover{
        background: none;
        border:2px solid #3949aa;
    }
    @media ${device.laptop} {
        margin: 10px 3px 0px;
    }
    @media ${device.tablet} {
        margin: 10px 5px 0px;
    }
`;
